import axios from "axios";

export class HTTPRequests extends Component {
  constructor(props) {
    super(props);

    this.state = {
      posts: [],
    };
  }

  componentDidMount(){
    axios.get('https://jsonplaceholder.typicode.com/posts').then()
  }

  render() {
    return (
      <div>
        <h2>Posts:</h2>
      </div>
    );
  }
}

export default HTTPRequests;
